import React, { Component } from 'react';
import Navbar from './Navbar';
import IntroSlides from './IntroSlides';
import Scroll from ''

class Cover extends Component {
  render() {
    return (
      <div id="cover">
        	<Navbar />
          <IntroSlides jump={this.props.jump}/>
          <Scroll />
      </div>
    );
  }
}

export default Cover;
